import React from "react";
import '../../styles/tags/Tags.css';
import AddButton from "../buttons/AddButton";

function Tags() {
    return (
        <div className="tags">
            <header>
                <h2 className="title">Теги</h2>
                <AddButton name="+ Новый тег"></AddButton>
                <ul className="tagsList">
                </ul>
            </header>
        </div>
    )
}

export default Tags;
